import React from 'react';
import Logo from '../../src/Assets/Logo.png';
import { Fragment } from "react";
import classes from './AboutMe.module.css';

const AboutMe = () => {

  return (
    <Fragment>
        <div className={classes.container}>
            <div>
                <p>About me</p>
            </div>
            <div>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. 
                    Donec convallis tellus eget magna feugiat scelerisque. 
                    Aliquam ligula turpis, gravida in lacus vitae, tempus dictum mauris. 
                    Duis id porttitor ante. Quisque mollis, lorem nec vehicula consequat, 
                    nulla diam lobortis dui, eget porta lorem nunc ac mi. </p>
            </div>
        </div>
    </Fragment>
  );
};

export default AboutMe;
